import React, { Component } from "react";

class Time extends Component {
  constructor() {
    super();
    this.state = {
      time: new Date()
    };
  }

  componentDidMount() {
    this.setState({
      time: new Date().toLocaleTimeString()
    });
  }
  render() {
    return <div>{this.time}</div>;
  }
}

export default Time;
